import React from 'react'

export const ProfileComponent = ({match}) => {
  return (
    <div className='grid max-h-screen place-items-center mt-40 mb-10 w-3/4 mx-auto'>{match} 
        <code>{JSON.stringify(match, null, 2)}</code>
    </div>
  )
}


export default ProfileComponent;
